import React from 'react';
import { connect } from 'react-redux';
import { BrowserRouter, Route, Redirect } from 'react-router-dom';
import Navigation from '../components/Navigation/Navigation';
import App from '../components/App';
import Maxes from '../components/Maxes/Maxes';
import Signin from '../components/Signin/Signin';
import Register from '../components/Register/Register';

class Router extends React.Component {
	render() {

		const PrivateSignin = ({ component: Component, ...rest}) => (
			<Route {...rest} render={(props) => (
				this.props.signIn.authenticated === false
					?<Component {...props} />
					:<Redirect to='/' />
				)} />
			);

		return (
			<BrowserRouter>
			<Navigation />
				<div>
					<Route path='/' component={App} exact />
					<Route path='/maxes' component={Maxes} exact />
					<Route path='/register' component={Register} exact />
					<PrivateSignin path='/signin' component={Signin} />
				</div>
			</BrowserRouter>	
		)
	}
}

const mapStateToProps = (state) => {
	return {
		signIn: state.signIn
	}
}

export default connect(mapStateToProps)(Router);
